description:
Stock status of target species: 
swordfish -  Not overfished or experiencing overfishing;
bigeye tuna -  Overfished and experiencing overfishing;
albacore tuna - Not overfished or experiencing overfishing; 
yellowfin tuna -  Overfished but not experiencing overfishing;
dolphinfish - not assessed individually but believed to be abundant because they are highly productive and widely distributed

